	PROCESS(COMPRESS);
	PROCESS(DECOMPRS);
	PROCESS(CRC32FUN);
	PROCESS(CRC64FUN);
	PROCESS(MEMCPYFN);
	PROCESS(MEMMEMFN);
	PROCESS(MEMXORRG);
	PROCESS(HCITYB64);
